import React from 'react'
import NFLlogo from '../NFLlogo.svg';

function Home() {
  return (
    <div>
        <p>
            <img src={NFLlogo} className="NFLlogo" alt="NFLlogo" />
        </p>
    </div>
  )
}

export default Home
